INSERT INTO `problems` VALUES (1,'你好 NLOJ','為了慶祝 NLOJ 成功架設，Cheng 想要叫你寫一個可以輸出 \"Hello, NLOJ!\"(不包含 \"\") 的程式，你能幫助他嗎？','','2024-10-22 12:14:18.634092','2024-10-22 12:14:18.634092','本題無輸入','輸出 \"Hello, NLOJ!\"(不包含 \"\") ','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(2,'A + B 問題','如題，給你兩數值 $a,\\ b$，請你求出 $a + b$ 的值。\r\n如果在這題只拿到 $30$ 分，請去面壁\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$1 \\le a,\\ b < $ $2$^$31$','','2024-10-22 13:23:48.154488','2024-10-22 15:32:48.380879','輸入僅一行，有兩個整數 $a,\\ b$','輸出一個整數代表 $a + b$ 的值','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(3,'[Interactive] 卡牌問題','$\\large \\color{red}{本題為互動題，請注意輸入輸出格式}$\r\n\r\n今天笨笨和聰聰在玩一個卡牌遊戲，\r\n遊戲是這樣的，他們會把卡牌排成一排並依序編號 $1$ ~ $n$，每張牌翻開會有數字 $0$ 或 $1$。\r\n你只有一次地翻開機會，假設翻開編號 $i$ 的牌，數字為 $1$，你可以獲得 $i$ 分，否則你拿不到分。\r\n一張牌只會被翻開一次。\r\n笨笨非常想贏，所以找了他弟小笨去偷看牌上的數字是多少，\r\n小笨並不知道規則，笨笨也不知道要怎麼跟他解釋，因為他太笨了，\r\n但是笨笨可以透過通話問小笨編號為 $i$ 的牌上的數字為何。\r\n可是小笨是個脾氣暴躁的人，你如果問他超過 $50$ 次他就會離家出走並且不給你繼續問，\r\n請問笨笨要翻哪一張牌分數才會贏過聰聰？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$1 \\le n \\le 50$','','2024-10-22 13:59:56.555290','2024-10-23 10:04:14.669603','本題是互動題，請在程式碼的開頭引入標頭檔  ```#include \"lib0003.h\"```，程式碼請勿輸入或輸出任何東西，並且請勿實作 ```int main()```函式。如果你這麼做可能會$\\color{red}{導致各種不可預期}$的結果。\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n請你實作以下函式：\r\n```int sol(int n)```：Judge 會從你的程式呼叫此函式，你要實作此函式並且回傳笨笨要翻哪一個編號的牌\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n你可以呼叫以下函式：\r\n```bool ask(int x)```：呼叫此函式可以問笨笨第 $x$ 張牌上的數字為 $0$ 還是 $1$，最多可呼叫 $50$ 次，並且要滿足 $1 \\le x \\le n$，否則你會獲得 $\\color{red}{Wrong\\ Answer}$','本題無輸出，請實作 ```int sol(int n)``` 回傳答案','以下是一份符合格式但是會回傳錯誤答案的程式碼\r\n```#include \"lib0003.h\"\r\nbool ask(int x);\r\nint sol(int n){\r\n	if(ask(1)) return 1;\r\n        return 2;\r\n}\r\n```',0,'#include <bits/stdc++.h>\r\n#include \"nlohmann/json.hpp\"\r\n\r\nusing json = nlohmann::json;\r\nusing namespace std;\r\n\r\nint main(int argc, char *argv[]){\r\n  ifstream f(argv[1]);\r\n  json data = json::parse(f);\r\n  ifstream out;\r\n  out.open(data[\"user_output_file\"]);\r\n  string res;\r\n  out >> res;\r\n  json ret;\r\n  if(res == \"AC\") ret[\"verdict\"] = \"AC\";\r\n  else ret[\"verdict\"] = \"WA\";\r\n  cout << ret;\r\n}','#ifndef LIB0003_H_\r\n#define LIB0003_H_\r\n\r\nbool ask(int x);\r\n\r\nint sol(int n);\r\n\r\n#endif',2,1,1,2,'#include \"lib0003.h\"\r\n#include <bits/stdc++.h>\r\n\r\nusing namespace std;\r\n\r\nint n, t;\r\nvector<int> v;\r\n\r\nbool ask(int x){\r\n  if(x < 1 || x > n || t > 50){\r\n    cout << \"WA\\n\";\r\n    exit(0);\r\n  }\r\n  t++;\r\n  return v[x - 1];\r\n}\r\n\r\nsigned main(){\r\n  cin >> n;\r\n  v.resize(n);\r\n  for(int &it : v) cin >> it;\r\n  int ans = 0;\r\n  for(int i = 0; i < n; i++) if(v[i]) ans = i;\r\n  ans++;\r\n  if(sol(n) != ans) cout << \"WA\\n\";\r\n  else cout << \"AC\\n\";\r\n}',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(4,'魔法咒語','Cheng 今天在魔法書上面看到一串魔法咒語 ```/\'\\\\*\"owo\"*//\'\\```，Cheng 想要叫你把他輸出出來！','','2024-10-27 05:42:08.673436','2024-10-27 12:55:35.459670','本題沒有輸入','輸出 ```/\'\\\\*\"owo\"*//\'\\```','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(5,'巧克力','Cheng 今天想要去買東西，發現巧克力竟然在特價！\r\n身為巧克力愛好者的 Cheng 絕對不會放過此機會，\r\n巧克力包裝上寫著「每盒 75，五盒 350 元」。\r\nCheng 今天帶了 $C$ 元，請問他最多可以買幾盒巧克力？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$1 \\le C \\le 10$^$9$','','2024-10-27 14:22:56.456362','2024-10-27 14:36:48.077941','輸入僅一行，有一個整數 $C$','輸出一個數字代表 Cheng 能買幾盒巧克力','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(6,'三位數的數字和','給你一個三位數字 $N$，請你輸出 $N$ 每位數字的數字和。\r\n如：\r\n$N = 391$，數字和為 $3 + 9 + 1 = 13$\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$100 \\le N \\le 999$','','2024-10-29 14:54:45.120057','2024-10-29 15:07:35.216786','輸入僅一行，有一個整數 $N$','輸出一個數字代表 $N$ 的數字和','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(7,'重新排列三位數','給你一個三位數字 $N$，請你依序輸出 $N$ 的第三位數、第一位數、第二位數\r\n如：\r\n$N = 391$，你要輸出 ```1 3 9```\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$100 \\le N \\le 999$','','2024-10-29 15:12:31.178959','2024-10-29 15:16:11.632388','輸入僅一行，有一個整數 $N$\r\n','請你依序輸出 $N$ 的第三位數、第一位數、第二位數，並以空白隔開\r\n','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(8,'差的奇偶性','今天給你兩個整數 $a,\\ b$，請問 $|a - b|$ 是奇數還是偶數？\r\n如果是奇數，請輸出 ```odd```，如果是偶數，請輸出 ```even```。\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$-10$^$18$ $\\le a, b \\le 10$^$18$','','2024-10-29 16:07:45.672537','2024-10-30 18:25:12.329423','輸入僅一行，有兩個整數，分別代表 $a$ 和 $b$。','依照題目敘述輸出 ```odd``` 或 ```even``` 代表答案','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(9,'木棍與三角形','今天 Cheng 有三個木棍，從短到長的木棍長度依序為 $a,\\ b,\\ c$。\r\nCheng 想知道能否使用這三個木棍排成一個三角形？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$0 \\le a \\le b \\le c \\le 1000$','','2024-10-29 16:13:03.813107','2024-10-30 18:58:49.055058','輸入僅一行，共三個數字，依序代表 $a,\\ b,\\ c$。','輸出 ```Yes``` 或 ```No``` 表示能否使用三木棍排成一個三角形。','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(10,'直角三角形','今天 Cheng 有三個木棍，從短到長的木棍長度依序為 $a,\\ b,\\ c$。\r\nCheng 想知道能否使用這三個木棍排成一個直角三角形？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$1 \\le a \\le b \\le c \\le 1000$','','2024-10-29 16:16:32.375961','2024-10-31 15:00:21.829558','輸入僅一行，共三個數字，依序代表 $a,\\ b,\\ c$。','輸出 ```Yes``` 或 ```No``` 表示能否使用三木棍排成一個直角三角形。','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(11,'一元二次方程式','Cheng 想知道 $ax$^$2$ $ + bx + c = 0$ 是否有解？\r\n所以給了你 $a,\\ b,\\ c$ 的值，要你解決這個問題！\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$-10$^$5$ $\\le a,\\ b,\\ c\\le 10$^$5$','','2024-10-29 16:18:05.085565','2024-10-31 15:06:39.166933','輸入僅一行，共三個數字，依序代表 $a,\\ b,\\ c$。','輸出 ```Yes``` 或 ```No``` 表示能否使用三木棍排成一個三角形。','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(12,'會考數學','這次 113 年會考數學的級距：\r\n![image](https://imgur.com/BglNELi.jpeg)\r\n給你 Cheng 的會考數學為 $S$ 分 (最多到小數後兩位)，請問他的數學會拿到甚麼標示？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$0 \\le S \\le 100$，且 $S$ 的小數最多兩位','','2024-10-31 09:15:14.066833','2024-11-01 16:30:41.546754','輸入僅一行，一個數字 $S$。','輸出 $S$ 分拿到的標示。','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1),(13,'區間判斷','給你兩個區間，範圍分別為 $[L_1,\\ R_1]$ 與 $[L_2,\\ R_2]$，\r\n問你兩區間是否重疊？\r\n\r\n<hr style=\"border-top:2px dashed #0066CC;\"/>\r\n\r\n對於所有測試資料：\r\n$-10$^$18$ $\\le L_1 \\le R_1 \\le 10$^$18$\r\n$-10$^$18$ $\\le L_2 \\le R_2 \\le 10$^$18$','','2024-10-31 09:45:59.740700','2024-11-01 16:58:25.821909','輸入共兩行，\r\n第一行有兩個數字分別代表 $L_1,\\ R_1$，\r\n第二行有兩個數字分別代表 $L_2,\\ R_2$。','輸出 ```Yes``` 與 ```No``` 代表兩區間是否重疊。','',0,'','',0,0,1,2,'',2,'',1,0,'',0,0,0,5000000,'',0,'',1);
